import{_ as i,c as o,o as t,ai as n}from"./chunks/framework.DLeCcjPJ.js";const p=JSON.parse('{"title":"Change Windows Edition","description":"This option can be found in the main menu of MAS, It can change Windows versions 7 through 11 and the equivalent server editions","frontmatter":{"layout":"doc","outline":"deep","title":"Change Windows Edition","description":"This option can be found in the main menu of MAS, It can change Windows versions 7 through 11 and the equivalent server editions","date":"2024-06-05T00:00:00.000Z","editLink":true},"headers":[],"relativePath":"wa/change_windows_edition.md","filePath":"wa/change_windows_edition.md"}'),a={name:"wa/change_windows_edition.md"};function r(s,e,d,l,h,c){return t(),o("div",null,e[0]||(e[0]=[n('<h1 id="change-windows-edition" tabindex="-1">Change Windows Edition <a class="header-anchor" href="#change-windows-edition" aria-label="Permalink to &quot;Change Windows Edition&quot;">​</a></h1><ul><li>This option can be found in the main menu of MAS.</li><li>It can change Windows versions 7 through 11 and the equivalent server editions.</li><li>The script incorporates four methods for edition changing: <ul><li>May&#39;s DISM Api Method - Used in Windows 10/11 Core to Non-Core edition change</li><li><a href="https://learn.microsoft.com/en-us/windows/deployment/upgrade/windows-edition-upgrades#upgrade-using-a-command-line-tool" target="_blank" rel="noreferrer">slmgr /ipk Method</a> - Used for Windows 10/11 virtual editions</li><li><a href="https://learn.microsoft.com/en-us/windows-server/get-started/upgrade-conversion-options" target="_blank" rel="noreferrer">DISM Method</a> - Used in Server 2016 and later server versions</li><li><a href="https://github.com/asdcorp/Set-WindowsCbsEdition" target="_blank" rel="noreferrer">CBS Upgrade Method</a> - Used in Windows versions before 10</li></ul></li><li>The script will show editions available via any of the four methods.</li><li>The script is future-proof, which means that it won&#39;t need an update upon the release of new editions because it can get the required product key from the system itself.</li><li>The script blocks changing to CountrySpecific and ServerRdsh, and to/from CloudEdition editions since this is not officially supported and it may cause issues.</li><li>The script cannot change: <ul><li>Non-Core editions to Core editions. (For example, Pro to Home isn&#39;t available.)</li><li>GAC editions to LTSC editions. (For example, Enterprise to Enterprise LTSC isn&#39;t available.)</li></ul></li></ul><h2 id="manual-edition-change" tabindex="-1">Manual Edition Change <a class="header-anchor" href="#manual-edition-change" aria-label="Permalink to &quot;Manual Edition Change&quot;">​</a></h2><p>If you want to manually change the edition instead of using the script, please follow the steps below.</p><h3 id="windows-10-11" tabindex="-1">Windows 10/11 <a class="header-anchor" href="#windows-10-11" aria-label="Permalink to &quot;Windows 10/11&quot;">​</a></h3><ul><li>To view the list of available editions, open the command prompt as admin and enter <code>dism /online /english /Get-TargetEditions</code></li><li>Get a key for the desired edition from <a href="./hwid#supported-products">here</a></li><li>If you are upgrading from Home to Pro, you will need to disable the Internet before performing the upgrade.</li><li>Now enter that product key with this command, replace <code>&lt;product_key&gt;</code> with the actual key. <code>changepk.exe /ProductKey &lt;product_key&gt;</code></li><li>In a Home to Pro upgrade, it may show an error, restart the system anyway. (Use the script if it&#39;s still not working)</li><li>Activate the changed edition with MAS, that&#39;s all.</li></ul><h3 id="windows-server-2016-and-later" tabindex="-1">Windows Server 2016 and Later <a class="header-anchor" href="#windows-server-2016-and-later" aria-label="Permalink to &quot;Windows Server 2016 and Later&quot;">​</a></h3><ul><li>Follow the <a href="https://learn.microsoft.com/en-us/windows-server/get-started/upgrade-conversion-options" target="_blank" rel="noreferrer">official Microsoft guide</a>. You can get the required keys from <a href="./kms38#supported-products">here</a>.</li></ul><hr><h2 id="troubleshooting" tabindex="-1">Troubleshooting <a class="header-anchor" href="#troubleshooting" aria-label="Permalink to &quot;Troubleshooting&quot;">​</a></h2><div class="danger custom-block"><p class="custom-block-title">Troubleshooting</p><p>Check <a href="./change_edition_issues">here</a></p><p>If your issue persists - <a href="./troubleshoot"><strong>Contact us</strong></a></p></div>',11)]))}const g=i(a,[["render",r]]);export{p as __pageData,g as default};
